UserConnection = UserConnection.AppConnection.SystemUserConnection;
GroupName = Convert.ToString(SysSettings.GetValue(UserConnection, "ConfItemSendingGroup"));

var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "SysUserInRole");

var usersContacts = esq.AddColumn("[SysAdminUnit:Id:SysUser].[Contact:Id:Contact].Id");

var esqFirstFilter = esq.CreateFilterWithParameters(
														FilterComparisonType.Equal,
														"[SysAdminUnit:Id:SysRole].Name",
														GroupName
													);
esq.Filters.Add(esqFirstFilter);
var items = esq.GetEntityCollection(UserConnection);
if (items.Count > 0) {
	foreach(var item in items) {
		var processSchemaManager = (ProcessSchemaManager)UserConnection.GetSchemaManager(@"ProcessSchemaManager");
		var processSchema = processSchemaManager.GetInstanceByName(@"InfConfItemNotificationProcess");
		var process = processSchema.CreateProcess(UserConnection);
		process.SetPropertyValue(@"ConfItem", ConfItem);
		process.SetPropertyValue(@"Contact", item.GetTypedColumnValue<Guid>(usersContacts.Name));
		process.Execute(UserConnection);
	}
}

return true;
